import React, {Component} from 'react';
import { View, Animated, Image, Text, TouchableOpacity, Dimensions, PanResponder } from 'react-native';

const SCREEN_HEIGHT = Dimensions.get('window').height
const SCREEN_WIDTH = Dimensions.get('window').width
const USERS = [
  { id: 1, uri: 'data:image/jpeg;base64,' },
  { id: 2, uri: 'data:image/jpeg;base64,' },
  { id: 3, uri: 'data:image/jpeg;base64,' },
  { id: 4, uri: 'data:image/jpeg;base64,' },
  { id: 5, uri: 'data:image/jpeg;base64,' },
];

class Swipe extends Component {

  constructor(props) {
    super(props);
    this.state= {
      currentIndex: 0
    };
    this.position = new Animated.ValueXY();
  }

  componentWillMount() {
    this.PanResponder = PanResponder.create({
      onStartShouldSetPanResponder: (evt, gestureState) => true,
      onPanResponderMove: (evt, gestureState) => {
        this.position.setValue({ x: gestureState.dx, y: gestureState.dy })
      },
      onPanResponderRelease: (evt, gestureState) => {
        
      }
    })
  }

  renderUser() {
    return USERS.map((item, idx)=> {

      if(idx < this.state.currentIndex) {
        return null;
      }

      else if( idx == this.state.currentIndex ) {
        // alert(item.id == this.state.currentIndex)
          return(
            <Animated.View key= {item.id} 
              {...this.PanResponder.panHandlers}
            style= {[{ transform: this.position.getTranslateTransform() }, 
                  {height: SCREEN_HEIGHT - 120, width: SCREEN_WIDTH, padding: 10, position: 'absolute' }]}>
              <Image key= {{ uri: item.uri}}
                style= {{ flex: 1, height: null, width: null, resizeMode: 'cover', borderRadius: 20 }}
                source= {item.uri}
              />
            </Animated.View>);
      }

      else {
          return(
          <Animated.View key= {item.id} 
            style= {[{height: SCREEN_HEIGHT - 120, width: SCREEN_WIDTH, padding: 10, position: 'absolute' }]}>
              <Image key= {item.id}
                style= {{ flex: 1, height: null, width: null, resizeMode: 'cover', borderRadius: 20 }}
                source= {{ uri: item.uri}}
              />
            </Animated.View>);
      }
    }).reverse();
  }

  render() {
    return(
      <View style= {{ flex: 1 }}>
        <View style= {{ height: 60 }}>

        </View>

        <View style= {{ flex: 1 }}>
          {this.renderUser()}
        </View>

        <View style= {{ height: 60 }}>

        </View>
      </View>
    );
  }
}

export default Swipe;